import React from 'react';

export function App(props) {
  return (
    <div className='App'>
      <form>
        <div>
          <input type="checkbox" required/>
          <label>Service #1</label>
          <br />
          <input type="checkbox" required/>
          <label>Service #2</label>
          <br />
          <input type="checkbox" required/>
          <label>Service #3</label>
          <br />
          <input type="submit" />
        </div>
      </form>
    </div>
  );
}

// Log to console
console.log('Hello console')
